create table user_hww(
id number(4) primary key,
username varchar2(20) not null,
password varchar2(20) not null,
email varchar2(50) not null
);

create sequence seq_ticket increment by 1 start with 1;


create table stopstation_hww(
id number(4) primary key, 
trainno varchar2(12) not null,
seq number(4) not null,
stationcode varchar2(30) not null,
stationname varchar2(30) not null
);


create table train_hww(
id number(4) primary key,
trainno varchar2(20) not null,
runtrainno varchar2(10) not null
);


